column8:
●ストレッチ＆光効果で色ムラ・毛穴・小ジワをピタッと隠し、ヨレ・シワっぽさゼロ！<br>
●SPF25・PA＋＋。紫外線・乾燥をしっかりカットし、日やけによるシミ・ソバカスを防いでしっとりなめらかな透明美肌に。<br>
●水・汗・皮脂に強いウォータープルーフタイプでベタつき・テカリ・色ぐすみを抑え、きれいな仕上がり長持ち。<br><br>

【使用方法】<br>
●使用するファンデーションがパウダーならその前に、リキッドならその後にお使い下さい。<br>
●クマ・くすみ・赤み・シミ・ソバカス・ニキビ跡等、気になる部分に直接塗り、指先で軽くたたき込むようになじませて下さい。<br>
●最後にパウダーで押さえると色が定着してきれいな仕上がり長持ち。<br><br>

【ご注意】<br>
○お使いのブラウザによって実際の色味と異なって見える場合があります。<br>
○お肌に異常がある時はご使用をお止めください。<br>
○極端に高温または低温の所、直射日光の当たるところ、湿度の高いところ、乳幼児の手の届くところには保管しないで下さい。<br>
○使用後は必ずフタをしっかり閉めてください。<br><br>

【成分】<br>
水、シクロペンタシロキサン、セチルジメチコンコポリオール、ソルビトール、BG、ベタイン、硫酸Ba、トリメチルシロキシケイ酸、ジメチコン、PEG-400、硫酸Mg、フェニルトリメチコン、（ビニルジメチコン／メチコンシルセスキオキサン）クロスポリマー、ジイソステアリン酸ポリグリセリル-2、水酸化AL、ステアリン酸、フェノキシエタノール、(ジメチコン／ビニルジメチコン)クロスポリマー、メチルパラベン、(ジメチコン／メチコン)コポリマー、酢酸セルロース、ヒバマタエキス、酸化チタン、タルク、酸化鉄<br><br>

【内容量】<br>
1個<br><br>

【販売元】<br>
株式会社井田ラボラトリーズ<br>
東京都新宿区市谷本村町1-1 住友市ヶ谷ビル3F<br>
電話：03-3260-0671<br><br>

【商品区分】<br>
化粧品<br><br>

［CANMAKE/ IDA Laboratories］

 <br><br><br><hr>
広告文責：株式会社モリキ<br>
電話：0269-38-0611<br><style type="text/css">
